        NATION.
      </p>

      <img
        id="devices_img"
        src="image/3.png"
        alt="There is some error in path"
      />

      <p className="textbox_4">
        Valves - Pumps - Pipes - IoT Drives & Controllers - Wires & Cables -
        Solar Systems - Motors
      </p>

      <hr />

      <h3>C.R.I. FLUID SYSTEMS PRODUCTS CATER TO DIVERSE SEGMENTS</h3>

      <Mainbox_2></Mainbox_2>

      <Footer></Footer>
    </>
  );
}

export default App;
